import {combineReducers} from 'redux'
//import movieListReducer from './movieListReducer'
import { reducer as tooltip } from 'redux-tooltip';
import SearHreducer from './searchReducer'
export default combineReducers({
    search:SearHreducer,
    tooltip
})
